import React from "react";
import PropTypes from "prop-types";
import productContainers from "../../containers/productContainer";

const Category = (props) => {
  let categoryName = props.children;
  let productsByCateGoryName = productContainers.findProductsByCategoryName();

  return (
    <div>
      <h1>{categoryName}</h1>
      <ul>
        {productsByCateGoryName.map((value) => {
          return <li>{value.name}</li>;
        })}
      </ul>
    </div>
  );
};

Category.propTypes = {};

export default Category;
